import React from 'react';
import { NavLink } from "react-router-dom";

function NavBar (){
    return (
        // <div className="nav">
        //     <p>Park Map</p>
        //     <p>Park List</p>
        //     <p>Photo Gallery</p>
        // </div>

        <div className="nav">
                <nav>
                    <NavLink to="/">Home</NavLink>

                    <NavLink to="/Map">Map</NavLink>

                    <NavLink to="/Gallery">Gallery</NavLink>
                </nav>
        </div>



    )
}

export default NavBar;
